import{_ as e,o as t,c as a,O as o}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 8.01-501 Lien of fieri facias on estate of debtor not capable of being levied on.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/8.01-501.md","filePath":"vacode/8.01-501.md"}'),i={name:"vacode/8.01-501.md"},r=o('<h1 id="§-8-01-501-lien-of-fieri-facias-on-estate-of-debtor-not-capable-of-being-levied-on" tabindex="-1">§ 8.01-501 Lien of fieri facias on estate of debtor not capable of being levied on. <a class="header-anchor" href="#§-8-01-501-lien-of-fieri-facias-on-estate-of-debtor-not-capable-of-being-levied-on" aria-label="Permalink to &quot;§ 8.01-501 Lien of fieri facias on estate of debtor not capable of being levied on.&quot;">​</a></h1><p>Every writ of fieri facias shall, in addition to the lien it has under §§ <a href="http://law.lis.virginia.gov/vacode/8.01-478/" target="_blank" rel="noreferrer">8.01-478</a> and <a href="http://law.lis.virginia.gov/vacode/8.01-479/" target="_blank" rel="noreferrer">8.01-479</a> on what is capable of being levied on under those sections, be a lien from the time it is delivered to a sheriff or other officer, or any person authorized to serve process pursuant to § <a href="http://law.lis.virginia.gov/vacode/8.01-293/" target="_blank" rel="noreferrer">8.01-293</a>, to be executed, on all the personal estate of or to which the judgment debtor is, or may afterwards and on or before the return day of such writ or before the return day of any wage garnishment to enforce the same, become, possessed or entitled, in which, from its nature is not capable of being levied on under such sections, except such as is exempt under the provisions of Title 34, and except that, as against an assignee of any such estate for valuable consideration, the lien by virtue of this section shall not affect him unless he had notice thereof at the time of the assignment.</p><p>Code 1950, § 8-431; 1977, c. 617; 1996, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?961+ful+CHAP1002" target="_blank" rel="noreferrer">1002</a>; 2006, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?061+ful+CHAP0575" target="_blank" rel="noreferrer">575</a>.</p>',3),n=[r];function s(f,l,c,d,h,p){return t(),a("div",null,n)}const g=e(i,[["render",s]]);export{_ as __pageData,g as default};
